import React, { useContext } from "react";
import { Context } from "../App";
import Navbar from "./components/Navbar/Navbar";
import IndexPage from "./pages/index/IndexPage";
import LogoutPage from "./pages/logout/LogoutPage";
import LoginPage from "./pages/signIn/LoginPage";
import RegisterPage from "./pages/signUp/RegisterPage";
import MyProfilePage from "./pages/profile/MyProfilePage";
import CookiesRequest from "./components/CookiesRequest";
import "./index.css";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import MatchDetails from "./pages/matchDetails/MatchDetails";
import CountryRankingPage from "./pages/countryRanking/CountryRankingPage";
import Ranking from "./components/Ranking";

function AppRoutes() {
  const { darkmode, showCookiesRequset } = useContext(Context);

  return (
    <BrowserRouter>
      <Navbar />
      <div className={darkmode === "darkmode" ? "routes" : "routes_lightmode"}>
        <Routes>
          <Route path="/" element={<IndexPage />} />
          <Route
            path="login"
            element={
              <ProtectedRoute anti={true}>
                <LoginPage />
              </ProtectedRoute>
            }
          />
          <Route
            path="logout"
            element={
              <ProtectedRoute>
                <LogoutPage />
              </ProtectedRoute>
            }
          />
          <Route
            path="signup"
            element={
              <ProtectedRoute anti={true}>
                <RegisterPage />
              </ProtectedRoute>
            }
          />
          <Route
            path="profile"
            element={
              <ProtectedRoute>
                <MyProfilePage />
              </ProtectedRoute>
            }
          />
          <Route path="about" element={<IndexPage />} />
          <Route path="match_details/:match_id" element={<MatchDetails />} />
          <Route path="country_ranking" element={<CountryRankingPage />} />
          <Route
            path="test"
            element={
              <Ranking
                head={{
                  0: {
                    name: "Label",
                    sortable: true,
                    asc: "asc",
                    sort_by: "string",
                  },
                  1: {
                    name: "Rank",
                    sortable: true,
                    asc: "desc",
                    sort_by: "number",
                  },
                  2: { name: "Size", sortable: false, asc: null },
                }}
                body={{
                  0: ["bbdsfdds", "12312312312", "asdasd"],
                  1: ["gfedcbga", "12312312312", "asdasd"],
                  2: ["abcdefg", "12312312312", "asdasd"],
                }}
              />
            }
          ></Route>
          <Route path="*" element={<h1>Page not found</h1>} />
        </Routes>
      </div>

      <img
        src="images/react/logo512.png"
        alt="background"
        className="background"
      />
      {showCookiesRequset && <CookiesRequest />}
    </BrowserRouter>
  );
}

export default AppRoutes;
